import React from 'react';
import ReactDOM from 'react-dom';
import Card from "./Card";
import Sdata from "./Sdata";
import ('./index.css');

// console.log(Sdata[0].sname);

function ncard(val) {
    return (
        <Card 
        imgsrc={val.imgscr}
        title={val.title}
        sname={val.sname}
        link={val.link}/>
    )
}
function add(){
    return (
        <div className="md_wrapper">
            <div className="md">
                <input type="text" placeholder="Name"/>
                <input type="text" placeholder="Title"/>
                <input type="image" placeholder="Title"/>
            </div>
        </div>
    )
}
ReactDOM.render( 
    <>

    <h1 className="heading_style">List of top 5 Netflix series in 2020
    <button Click={add()} className="add_btn">Add+</button></h1>
    
    
    {Sdata.map(ncard)};
    </>,
    document.getElementById('root')
    );
